function Add(){

    const navigate=useNavigate()
    const {empid}=useParams

    useEffect(()=>{
        fetch("http://localhost:3006/posts/"+empid)
        .then((jos)=>{
           return jos.json()
        })
        .then((das)=>{
            setId(das.id)
            setName(das.name)
            setAge(das.age)
            setEmail(das.email)
            setMoblie(das.mobile)
            setCity(das.city)
        }) 
  
    },[])

    const control=()=>{
    
        navigate("/")
      }
   
    return(
        <div className="container">
            <div className="card">
                <div className="card-title">
                     <h2 >Welcome to google classroom</h2>
                     <div>
                        
                        <button className="btn btn-danger" onClick={control}>
                            Back
                        </button>
                     </div>
                </div>
                <div className="card-body">

                </div>
            </div>
        </div>
    )
}

export default Add;
